import React from 'react'

const AddLocationCoordinates = (props) => {
  return (
    <div>
        AddLocationCoordinates
        <br></br>
        <button onClick={() => props.toggleClose()}>Close</button>
    </div>
  )
}

export default AddLocationCoordinates
